+ */
+public enum HnsStatus {
+    /**
+     * Enabled
+     */
+    Enabled("Enabled");
+
+    private String hnsString;
+
+    private HnsStatus(String hnsString) {
+        this.hnsString = hnsString;
+    }
+
+    @Override
+    public String toString() {
+        return this.hnsString;
+    }
+
+    public static HnsStatus parse(String hnsString) {
+        for (HnsStatus st : HnsStatus.values()) {
+            if (st.toString().equals(hnsString)) {
+                return st;
+            }
+        }
+
+        throw new IllegalArgumentException("Unable to parse " + hnsString);
+    }
+}

